import './main.css';
// {id,img,price,place,desc}
// without braces 'props'
export default function Card({id,img,price,place,desc,removeCard}){
    return (
        <div>
                <div>
                    <img src={img} className="card-img"/>
                </div>
                <div className="card-price">{price}</div>
                <span className="card-city">{place}</span>
                <p>
                    {desc}
                </p>
                <button className='card-button' onClick={removeCard(id)}>
                    Not Interested
                   
                </button>
        </div>
    );
}
